llm_output:
function transfer(address recipient, uint256 amount) public {
    require(recipient != address(0), "Transfer to the zero address is not allowed.");
    require(amount > 0, "Transfer amount must be greater than zero.");
    require(msg.sender == owner, "Only the owner can initiate transfers.");
    require(!_enableWatchDogLimitsFlag, "Watchdog limits are enabled.");
    require(block.number > lastTransferBlock[tx.origin], "Only one transfer per block allowed.");

    lastTransferBlock[tx.origin] = block.number;

    require(balanceOf[msg.sender] >= amount, "Insufficient balance.");
    require(balanceOf[recipient] + amount >= balanceOf[recipient], "SafeMath: addition overflow.");

    balanceOf[msg.sender] -= amount;
    balanceOf[recipient] += amount;

    emit Transfer(msg.sender, recipient, amount);
}

